import React, { useState } from 'react';
import {
    Container,
    Form,
    FormGroup,
    Label,
    Input,
    Row,
    Col
  } from 'reactstrap/';
import { Box, Grid, Image, Text, Icon } from "@chakra-ui/core";

const ErrorCard = (props) => {

    return (
        <Box d="flex" justifyContent="center" alignItems="center" className="bg-white rounded">
            <Box style={{ margin: "75px 20px 75px 20px" }}>
                 <Icon style={{ textShadow: "1px 1px 1px #ccc" }} name="lock" size="75px" w="100%" alignSelf="center" color="gray.300"/>
                <Text m="30px" 
                color="gray.600" 
                    fontWeight="bold"
                    letterSpacing="wide">
                    It looks like the user is private or doesn't have any photos.
                </Text>
            </Box>
        </Box>
    );
}

export default ErrorCard;
